import React from 'react'
import Header from '../common/Header'
import restImg from "../../assets/restdet.png"
import '../Styles/RestDetails.css'
import { Tab, Tabs, TabList, TabPanel } from 'react-tabs'
import 'react-tabs/style/react-tabs.css'
//import Tabs, { TabPane } from 'rc-tabs';


export default function RestaurantDetails() {
  //var callback = function(key) {};

  const options = {
    tabs: [
      {
        id: '1',
        title: 'tab 1',
        panelComponent: (porps) => <p> panel 1 </p>,
      },
      {
        id: '2',
        title: 'tab 2',
        panelComponent: (porps) => <p> panel 2 </p>,
      },
    ],
    selectedTabID: '1',
  };
  const [TabList, PanelList] = useDynTabs(options);

  return (
    <div>
      <Header/>
      <div className='d-flex justify-content-around'>
          <img className='rounded m-4' src={restImg} alt="restaurantimage" width={"1130px"} height={"352"}/>
      </div>

      <div className='headtext'>
        The Big Chill Cakery
      </div>

      <button className='btn btn-danger float-end m-4'>Place Online Order</button>

      <div>
      <Tabs>
        <TabList>
          <Tab>Title 1</Tab>
          <Tab>Title 2</Tab>
        </TabList>

        <TabPanel>
          <h2>Any content 1</h2>
        </TabPanel>
        <TabPanel>
          <h2>Any content 2</h2>
        </TabPanel>
      </Tabs>
      </div>


    </div>
  )
}
